INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (1, 'The Godfather', 'Francis Ford Coppola', '/title/tt0068646/', '1972', '$6,000,000', '175 min', '9.2', '1973-10-01', 'Crime, Drama', 'The aging patriarch of an organized crime dynasty transfers control of his clandestine empire to his reluctant son.', 'When the aging head of a famous crime family decides to transfer his position to one of his subalterns, a series of unfortunate events start happening to the family, and a war begins between all the well-known families leading to insolence, deportation, murder and revenge, and ends with the favorable successor being finally chosen.', 'https://m.media-amazon.com/images/M/MV5BM2MyNjYxNmUtYTAwNi00MTYxLWJmNWYtYzZlODY3ZTk3OTFlXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMjE4MDM4OTM3Nl5BMl5BanBnXkFtZTYwNDEwMTI2._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTA3MDE0OTQ5MDBeQTJeQWpwZ15BbWU4MDAwNzM3MTIy._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BYTgzZTJlMDUtMGIxNy00ODJiLWI3NjAtYzQ4OTQ3MGQ3ZGYwXkEyXkFqcGdeQXVyMDc2NTEzMw@@._V1_.jpg', 'https://www.imdb.com/videoembed/vi1348706585', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (2, 'The Godfather: Part II', 'Francis Ford Coppola', '/title/tt0071562/', '1974', '$13,000,000', '202 min', '9.0', '1974-12-20', 'Crime, Drama', 'The early life and career of Vito Corleone in 1920s New York City is portrayed, while his son, Michael, expands and tightens his grip on the family crime syndicate.', 'The continuing saga of the Corleone crime family tells the story of a young Vito Corleone growing up in Sicily and in 1910s New York; and follows Michael Corleone in the 1950s as he attempts to expand the family business into Las Vegas, Hollywood and Cuba.', 'https://m.media-amazon.com/images/M/MV5BMWMwMGQzZTItY2JlNC00OWZiLWIyMDctNDk2ZDQ2YjRjMWQ0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BNDI0Mzg1MDA4NF5BMl5BanBnXkFtZTgwMTM4NjIwMjE@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTgwNjczMjEzMl5BMl5BanBnXkFtZTgwMTM0OTY0NjM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BYzRhOTEzMWMtYjM4YS00ZjFmLTg0MWMtZjgyNjM4ODg5NTRiXkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_.jpg', 'https://www.imdb.com/videoembed/vi696162841', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (4, 'Pulp Fiction', 'Quentin Tarantino', '/title/tt0110912/', '1994', '$8,000,000', '154 min', '8.9', '1995-04-14', 'Crime, Drama', 'The lives of two mob hitmen, a boxer, a gangster''s wife, and a pair of diner bandits intertwine in four tales of violence and redemption.', 'Jules Winnfield (Samuel L. Jackson) and Vincent Vega (John Travolta) are two hit men who are out to retrieve a suitcase stolen from their employer, mob boss Marsellus Wallace (Ving Rhames). Wallace has also asked Vincent to take his wife Mia (Uma Thurman) out a few days later when Wallace himself will be out of town. Butch Coolidge (Bruce Willis) is an aging boxer who is paid by Wallace to lose his fight. The lives of these seemingly unrelated people are woven together comprising of a series of funny, bizarre and uncalled-for incidents.', 'https://m.media-amazon.com/images/M/MV5BNGNhMDIzZTUtNTBlZi00MTRlLWFjM2ItYzViMjE3YzI5MjljXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMGFiNTg2YzctNzhlMy00MTZiLTgxNzctZjI1M2U1YzBiNWY1XkEyXkFqcGdeQXVyODQ0NDA3OTM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BNTY1MzgzOTYxNV5BMl5BanBnXkFtZTgwMDI4OTEwMjE@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTA0OTk2NzIzNzReQTJeQWpwZ15BbWU4MDcxNzI2ODEx._V1_.jpg', 'https://www.imdb.com/videoembed/vi2620371481', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (5, 'Fight Club', 'David Fincher', '/title/tt0137523/', '1999', '$63,000,000', '139 min', '8.8', '1999-12-10', 'Drama', 'An insomniac office worker and a devil-may-care soapmaker form an underground fight club that evolves into something much, much more.', 'A nameless first person narrator (Edward Norton) attends support groups in attempt to subdue his emotional state and relieve his insomniac state. When he meets Marla (Helena Bonham Carter), another fake attendee of support groups, his life seems to become a little more bearable. However when he associates himself with Tyler (Brad Pitt) he is dragged into an underground fight club and soap making scheme. Together the two men spiral out of control and engage in competitive rivalry for love and power. When the narrator is exposed to the hidden agenda of Tyler''s fight club, he must accept the awful truth that Tyler may not be who he says he is.', 'https://m.media-amazon.com/images/M/MV5BMjJmYTNkNmItYjYyZC00MGUxLWJhNWMtZDY4Nzc1MDAwMzU5XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTQ2Mzg0MDMyOV5BMl5BanBnXkFtZTYwNTc1Mzc3._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTc3OTA1MzM3N15BMl5BanBnXkFtZTYwNDA3NDYy._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMjY2MTUyMzgzNF5BMl5BanBnXkFtZTYwOTA3NDYy._V1_.jpg', 'https://www.imdb.com/videoembed/vi781228825', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (7, 'The Usual Suspects', 'Bryan Singer', '/title/tt0114814/', '1995', '$6,000,000', '106 min', '8.6', '1995-12-15', 'Crime, Mystery, Thriller', 'A sole survivor tells of the twisty events leading up to a horrific gun battle on a boat, which began when five criminals met at a seemingly random police lineup.', 'Following a truck hijack in New York, five conmen are arrested and brought together for questioning. As none of them are guilty, they plan a revenge operation against the police. The operation goes well, but then the influence of a legendary mastermind criminal called Keyser Söze is felt. It becomes clear that each one of them has wronged Söze at some point and must pay back now. The payback job leaves 27 men dead in a boat explosion, but the real question arises now: Who actually is Keyser Söze?', 'https://m.media-amazon.com/images/M/MV5BYTViNjMyNmUtNDFkNC00ZDRlLThmMDUtZDU2YWE4NGI2ZjVmXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTc3OTc0NTcxOF5BMl5BanBnXkFtZTcwMDI4Mjg3NA@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTk5ODY2NjIwNl5BMl5BanBnXkFtZTcwNTA4Mjg3NA@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTQ2MzczOTU3MV5BMl5BanBnXkFtZTcwOTE4Mjg3NA@@._V1_.jpg', 'https://www.imdb.com/videoembed/vi2717188377', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (8, 'Spirited Away', 'Hayao Miyazaki, Kirk Wise', '/title/tt0245429/', '2001', '$19,000,000', '125 min', '8.6', '2004-06-18', 'Animation, Adventure, Family, Fantasy, Mystery', 'During her family''s move to the suburbs, a sullen 10-year-old girl wanders into a world ruled by gods, witches, and spirits, and where humans are changed into beasts.', 'Chihiro and her parents are moving to a small Japanese town in the countryside, much to Chihiro''s dismay. On the way to their new home, Chihiro''s father makes a wrong turn and drives down a lonely one-lane road which dead-ends in front of a tunnel. Her parents decide to stop the car and explore the area. They go through the tunnel and find an abandoned amusement park on the other side, with its own little town. When her parents see a restaurant with great-smelling food but no staff, they decide to eat and pay later. However, Chihiro refuses to eat and decides to explore the theme park a bit more. She meets a boy named Haku who tells her that Chihiro and her parents are in danger, and they must leave immediately. She runs to the restaurant and finds that her parents have turned into pigs. In addition, the theme park turns out to be a town inhabited by demons, spirits, and evil gods. At the center of the town is a bathhouse where these creatures go to relax. The owner of the bathhouse ...', 'https://m.media-amazon.com/images/M/MV5BOGJjNzZmMmUtMjljNC00ZjU5LWJiODQtZmEzZTU0MjBlNzgxL2ltYWdlXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BODM2OTgyOTY1OV5BMl5BanBnXkFtZTgwOTY1MTMyMDE@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMjMyNjg2NzQxN15BMl5BanBnXkFtZTgwMjc1MTMyMDE@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTgxMzMwMjg3M15BMl5BanBnXkFtZTgwMDM0NDE0ODE@._V1_.jpg', 'https://www.imdb.com/videoembed/vi3619684633', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (10, 'The Green Mile', 'Frank Darabont', '/title/tt0120689/', '1999', '$60,000,000', '189 min', '8.5', '2000-03-17', 'Crime, Drama, Fantasy, Mystery', 'The lives of guards on Death Row are affected by one of their charges: a black man accused of child murder and rape, yet who has a mysterious gift.', 'Death Row guards at a penitentiary, in the 1930''s, have a moral dilemma with their job when they discover one of their prisoners, a convicted murderer, has a special gift.', 'https://m.media-amazon.com/images/M/MV5BMTUxMzQyNjA5MF5BMl5BanBnXkFtZTYwOTU2NTY3._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMjA3OTk0NDk3OV5BMl5BanBnXkFtZTYwNTY2NTY3._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMjAxMDUwNTc4N15BMl5BanBnXkFtZTYwOTY2NTY3._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BN2Q3Zjc3YjYtMDhiNi00MTZlLWI0YTItMDY5N2MxNjAyN2YyXkEyXkFqcGdeQXVyNzgwNDExNTg@._V1_.jpg', 'https://www.imdb.com/videoembed/vi552796441', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (11, 'Interstellar', 'Christopher Nolan', '/title/tt0816692/', '2014', '$165,000,000', '169 min', '8.6', '2014-11-07', 'Adventure, Drama, Sci-Fi', 'A team of explorers travel through a wormhole in space in an attempt to ensure humanity''s survival.', 'Earth''s future has been riddled by disasters, famines, and droughts. There is only one way to ensure mankind''s survival: Interstellar travel. A newly discovered wormhole in the far reaches of our solar system allows a team of astronauts to go where no man has gone before, a planet that may have the right environment to sustain human life.', 'https://m.media-amazon.com/images/M/MV5BZjdkOTU3MDktN2IxOS00OGEyLWFmMjktY2FiMmZkNWIyODZiXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTQ4NjgyNTI1MF5BMl5BanBnXkFtZTgwNzcyODgxMzE@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMjAzOTQxNTEyM15BMl5BanBnXkFtZTgwMDY1MDgzMzE@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMzQ5ODE2MzEwM15BMl5BanBnXkFtZTgwMTMyODgxMzE@._V1_.jpg', 'https://www.imdb.com/videoembed/vi1586278169', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (12, 'The Prestige', 'Christopher Nolan', '/title/tt0482571/', '2006', '$40,000,000', '130 min', '8.5', '2006-12-22', 'Drama, Mystery, Sci-Fi, Thriller', 'After a tragic accident, two stage magicians engage in a battle to create the ultimate illusion while sacrificing everything they have to outwit each other.', 'In the end of the Nineteenth Century, in London, Robert Angier, his beloved wife Julia McCullough and Alfred Borden are friends and assistants of a magician. When Julia accidentally dies during a performance, Robert blames Alfred for her death and they become enemies. Both become famous and rival magicians, sabotaging the performance of the other on the stage. When Alfred performs a successful trick, Robert becomes obsessed trying to disclose the secret of his competitor with tragic consequences.', 'https://m.media-amazon.com/images/M/MV5BMjA4NDI0MTIxNF5BMl5BanBnXkFtZTYwNTM0MzY2._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BODc0MzkxOTg5N15BMl5BanBnXkFtZTcwODkzNDMyMw@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTYxMjIwNjI2Nl5BMl5BanBnXkFtZTcwOTkzNDMyMw@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMjI1NzIyNDk1N15BMl5BanBnXkFtZTcwMjA0NDMyMw@@._V1_.jpg', 'https://www.imdb.com/videoembed/vi2885334553', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (13, 'WALL·E', 'Andrew Stanton', '/title/tt0910970/', '2008', '$180,000,000', '98 min', '8.4', '2008-09-26', 'Animation, Adventure, Family, Sci-Fi', 'In the distant future, a small waste-collecting robot inadvertently embarks on a space journey that will ultimately decide the fate of mankind.', 'In a distant, but not so unrealistic, future where mankind has abandoned earth because it has become covered with trash from products sold by the powerful multi-national Buy N Large corporation, WALL-E, a garbage collecting robot has been left to clean up the mess. Mesmerized with trinkets of Earth''s history and show tunes, WALL-E is alone on Earth except for a sprightly pet cockroach. One day, EVE, a sleek (and dangerous) reconnaissance robot, is sent to Earth to find proof that life is once again sustainable. WALL-E falls in love with EVE. WALL-E rescues EVE from a dust storm and shows her a living plant he found amongst the rubble. Consistent with her "directive", EVE takes the plant and automatically enters a deactivated state except for a blinking green beacon. WALL-E, doesn''t understand what has happened to his new friend, but, true to his love, he protects her from wind, rain, and lightning, even as she is unresponsive. One day a massive ship comes to reclaim EVE, but WALL-E, ...', 'https://m.media-amazon.com/images/M/MV5BMjExMTg5OTU0NF5BMl5BanBnXkFtZTcwMjMxMzMzMw@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BNzM0OTU2NzM0NV5BMl5BanBnXkFtZTcwNjIwMzMzMw@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BNDExNzM3Mzc2MV5BMl5BanBnXkFtZTcwMDIwMzMzMw@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTU1MjY5ODc4M15BMl5BanBnXkFtZTcwODU2MjY3MQ@@._V1_.jpg', 'https://www.imdb.com/videoembed/vi2192703769', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (14, 'The Dark Knight Rises', 'Christopher Nolan', '/title/tt1345836/', '2012', '$250,000,000', '164 min', '8.4', '2012-07-27', 'Action, Thriller', 'Eight years after the Joker''s reign of anarchy, Batman, with the help of the enigmatic Catwoman, is forced from his exile to save Gotham City, now on the edge of total annihilation, from the brutal guerrilla terrorist Bane.', 'Despite his tarnished reputation after the events of The Dark Knight, in which he took the rap for Dent''s crimes, Batman feels compelled to intervene to assist the city and its police force which is struggling to cope with Bane''s plans to destroy the city.', 'https://m.media-amazon.com/images/M/MV5BMTk4ODQzNDY3Ml5BMl5BanBnXkFtZTcwODA0NTM4Nw@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTUxMjU0NzQ5NF5BMl5BanBnXkFtZTcwMjExODQxOA@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTY1NTAxOTI5NF5BMl5BanBnXkFtZTcwNDExODQxOA@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTU0OTg2MTE2Ml5BMl5BanBnXkFtZTcwNTUwMzQxOA@@._V1_.jpg', 'https://www.imdb.com/videoembed/vi2376312089', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (15, 'Inglourious Basterds', 'Quentin Tarantino, Eli Roth', '/title/tt0361748/', '2009', '$75,000,000', '153 min', '8.3', '2009-08-21', 'Adventure, Drama, War', 'In Nazi-occupied France during World War II, a plan to assassinate Nazi leaders by a group of Jewish U.S. soldiers coincides with a theatre owner''s vengeful plans for the same.', 'In German-occupied France, young Jewish refugee Shosanna Dreyfus witnesses the slaughter of her family by Colonel Hans Landa. Narrowly escaping with her life, she plots her revenge several years later when German war hero Fredrick Zoller takes a rapid interest in her and arranges an illustrious movie premiere at the theater she now runs. With the promise of every major Nazi officer in attendance, the event catches the attention of the "Basterds", a group of Jewish-American guerrilla soldiers led by the ruthless Lt. Aldo Raine. As the relentless executioners advance and the conspiring young girl''s plans are set in motion, their paths will cross for a fateful evening that will shake the very annals of history.', 'https://m.media-amazon.com/images/M/MV5BOTJiNDEzOWYtMTVjOC00ZjlmLWE0NGMtZmE1OWVmZDQ2OWJhXkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BOWM5OGUzY2UtNTIwZC00YjYxLWI4ZjMtYzY0MWZiZjBmOTFmL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMzk1MzY3NzM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMjMyNzcwODE2MV5BMl5BanBnXkFtZTgwNTAwNDI2MTI@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTVhMjFjOTUtNmZkYi00NzRhLWFjMTItZDg4MGQ2NjY3MjEwL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMzk1MzY3NzM@._V1_.jpg', 'https://www.imdb.com/videoembed/vi3738173977', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (16, 'Batman Begins', 'Christopher Nolan', '/title/tt0372784/', '2005', '$150,000,000', '140 min', '8.3', '2005-06-17', 'Action, Adventure, Thriller', 'After training with his mentor, Batman begins his fight to free crime-ridden Gotham City from corruption.', 'When his parents are killed, billionaire playboy Bruce Wayne relocates to Asia where he is mentored by Henri Ducard and Ra''s Al Ghul in how to fight evil. When learning about the plan to wipe out evil in Gotham City by Ducard, Bruce prevents this plan from getting any further and heads back to his home. Back in his original surroundings, Bruce adopts the image of a bat to strike fear into the criminals and the corrupt as the icon known as ''Batman''. But it doesn''t stay quiet for long.', 'https://m.media-amazon.com/images/M/MV5BZmUwNGU2ZmItMmRiNC00MjhlLTg5YWUtODMyNzkxODYzMmZlXkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMzA4MzI2MjMwM15BMl5BanBnXkFtZTcwMDA5OTIyNw@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BNjM4ODM4MzQtZTQ2Ny00OTc0LWI2ODMtMzgxMTU4MGJhZWEzXkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMjQ2NzI1NTcwOF5BMl5BanBnXkFtZTgwOTY3MTEyMjI@._V1_.jpg', 'https://www.imdb.com/videoembed/vi2992219161', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (17, 'V for Vendetta', 'James McTeigue', '/title/tt0434409/', '2005', '$54,000,000', '132 min', '8.2', '2006-03-31', 'Action, Drama, Sci-Fi, Thriller', 'In a future British tyranny, a shadowy freedom fighter, known only by the alias of "V", plots to overthrow it with the help of a young woman.', 'Tells the story of Evey Hammond and her unlikely but instrumental part in bringing down the fascist government that has taken control of a futuristic Great Britain. Saved from a life-and-death situation by a man in a Guy Fawkes mask who calls himself V, she learns a general summary of V''s past and, after a time, decides to help him bring down those who committed the atrocities that led to Britain being in the shape that it is in.', 'https://m.media-amazon.com/images/M/MV5BYzllMjJkODAtYjMwMi00YmNhLWFhYzAtZjZjODg5YzEwOGUwXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMjM4NzI0MjcwN15BMl5BanBnXkFtZTgwMzY4OTE1MDI@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTg5NzQ3NjU1MF5BMl5BanBnXkFtZTcwNzk0MTYyNw@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTMzMjYwODM5NF5BMl5BanBnXkFtZTcwNjk0MTYyNw@@._V1_.jpg', 'https://www.imdb.com/videoembed/vi4276093209', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (3, 'The Dark Knight', 'Christopher Nolan', '/title/tt0468569/', '2008', '$185,000,000', '152 min', '9.0', '2008-07-25', 'Action, Crime, Drama, Thriller', 'When the menace known as the Joker emerges from his mysterious past, he wreaks havoc and chaos on the people of Gotham. The Dark Knight must accept one of the greatest psychological and physical tests of his ability to fight injustice.', 'Set within a year after the events of Batman Begins, Batman, Lieutenant James Gordon, and new district attorney Harvey Dent successfully begin to round up the criminals that plague Gotham City until a mysterious and sadistic criminal mastermind known only as the Joker appears in Gotham, creating a new wave of chaos. Batman''s struggle against the Joker becomes deeply personal, forcing him to "confront everything he believes" and improve his technology to stop him. A love triangle develops between Bruce Wayne, Dent and Rachel Dawes.', 'https://m.media-amazon.com/images/M/MV5BMTMxNTMwODM0NF5BMl5BanBnXkFtZTcwODAyMTk2Mw@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BZGNkZjQwN2UtYjhlMS00ZGU5LWE3YTItYjE5MTc5MDZlYjgzXkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTgzMzkyNjAwOV5BMl5BanBnXkFtZTcwNzgzMTk2Mw@@._V1_SX1777_CR0,0,1777,747_AL_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTQ1NTkzMDc3N15BMl5BanBnXkFtZTcwNjI4ODg3MQ@@._V1_.jpg', 'https://www.imdb.com/videoembed/vi324468761', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (6, 'Inception', 'Christopher Nolan', '/title/tt1375666/', '2010', '$160,000,000', '148 min', '8.8', '2010-07-30', 'Action, Adventure, Sci-Fi, Thriller', 'A thief who steals corporate secrets through the use of dream-sharing technology is given the inverse task of planting an idea into the mind of a CEO.', 'Dom Cobb is a skilled thief, the absolute best in the dangerous art of extraction, stealing valuable secrets from deep within the subconscious during the dream state, when the mind is at its most vulnerable. Cobb''s rare ability has made him a coveted player in this treacherous new world of corporate espionage, but it has also made him an international fugitive and cost him everything he has ever loved. Now Cobb is being offered a chance at redemption. One last job could give him his life back but only if he can accomplish the impossible - inception. Instead of the perfect heist, Cobb and his team of specialists have to pull off the reverse: their task is not to steal an idea but to plant one. If they succeed, it could be the perfect crime. But no amount of careful planning or expertise can prepare the team for the dangerous enemy that seems to predict their every move. An enemy that only Cobb could have seen coming.', 'https://m.media-amazon.com/images/M/MV5BMjAxMzY3NjcxNF5BMl5BanBnXkFtZTcwNTI5OTM0Mw@@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BYmY4ZmM5MTgtZjUzMC00YWVhLTg4NDMtNzNjYTY1Njc0ZDE0L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNDAxOTExNTM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BN2ZjZTA4MGUtNGFiOS00MmExLTljMTQtNmVlODJmYTU2ZDU4L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNDAxOTExNTM@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BYmY4ZmM5MTgtZjUzMC00YWVhLTg4NDMtNzNjYTY1Njc0ZDE0L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNDAxOTExNTM@._V1_.jpg', 'https://www.imdb.com/videoembed/vi4219471385', 19.90, null, null);
INSERT INTO public.movies (id, title, directors, imdbmid, year, budget, runtime, rating, releasedate, genre, plotmin, plot, poster, photo1, photo2, photo3, trailer, price, created_at, updated_at) VALUES (9, 'Léon: The Professional', 'Luc Besson', '/title/tt0110413/', '1994', '$20,000,000', '110 min', '8.6', '1995-04-28', 'Crime, Drama, Thriller', 'Mathilda, a 12-year-old girl, is reluctantly taken in by Léon, a professional assassin, after her family is murdered. Léon and Mathilda form an unusual relationship, as she becomes his protégée and learns the assassin''s trade.', 'After her father, mother, older sister and little brother are killed by her father''s employers, the 12-year-old daughter of an abject drug dealer is forced to take refuge in the apartment of a professional hitman who at her request teaches her the methods of his job so she can take her revenge on the corrupt DEA agent who ruined her life by killing her beloved brother.', 'https://m.media-amazon.com/images/M/MV5BZDAwYTlhMDEtNTg0OS00NDY2LWJjOWItNWY3YTZkM2UxYzUzXkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTgxMTY5MDM3MF5BMl5BanBnXkFtZTgwNjc5MTQzMTI@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BYzAyNjNiZTctNWIzOC00NmEyLWE2MzYtMmJiMWRkMTZjMDFmXkEyXkFqcGdeQXVyNjA3NDI0NDg@._V1_.jpg', 'https://m.media-amazon.com/images/M/MV5BMTgxMTY5MDM3MF5BMl5BanBnXkFtZTgwNjc5MTQzMTI@._V1_.jpg', 'https://www.imdb.com/videoembed/vi2744254745', 19.90, null, null);
